    {
        picture: require('../Images/IMG_4230.jpg'),
    },
    {
        picture: require('../Images/IMG_4255.jpg'),
    },
    {
        picture: require('../Images/IMG_4289.jpg'),
    },
    {
        picture: require('../Images/IMG_4264.jpg'),
    },
    {
        picture: require('../Images/IMG_4287-2.jpg'),
    },
]
function Image() {

    return(
        <>
        <img src = {require('../Images/IMG_4287-2.jpg')}/>
        </>
    );
}

export default Image
